import styled from "styled-components";
import { motion } from "framer-motion";

const DshbordComponenetStyle = styled(motion.div)``;
const DashbordComponenet = () => {
  return (
    <DshbordComponenetStyle>
      <div className="tags">
        {[
          "Dash board",
          "Posts",
          "Edit profile",
          "Subscription",
          "Billing address",
          "Submit post",
        ]}
      </div>
    </DshbordComponenetStyle>
  );
};

export default DashbordComponenet;
